import React, { useState } from 'react';
import { GoogleOAuthProvider, GoogleLogin } from '@react-oauth/google';  // Importa correttamente

const clientId = '694573141536-tp3qpdtg19e16d4rftikofrr40ovi4sc.apps.googleusercontent.com';  // Usa il tuo Client ID

function App() {
  const [user, setUser] = useState(null);

  const handleLoginSuccess = (response) => {
    console.log('Login Success:', response);
    // Puoi ora recuperare i dati dell'utente e fare qualcosa con essi
    setUser(response);
  };

  const handleLoginFailure = (error) => {
    console.log('Login Failed:', error);
  };

  return (
    <GoogleOAuthProvider clientId={clientId}>  {/* Fornisce il Client ID */}
      <div>
        {!user ? (
          <GoogleLogin
            onSuccess={handleLoginSuccess}  // Gestisce il successo
            onFailure={handleLoginFailure}  // Gestisce il fallimento
          />
        ) : (
          <div>Benvenuto, {user.profileObj.name}!</div>
        )}
      </div>
    </GoogleOAuthProvider>
  );
}

export default App;
